import {ToDoItem} from "./MyComponents/ToDoItem"

export const ToDOs = (props) => {
  return (
    <div className='container'>
      <h3>Todos List</h3>
      {/* props.todos */}
      <ToDoItem  todo={props.todos[0]}/>
      
      
    </div>
  )
}
